import axios from 'axios';

const STUDENT_API_BASE_URL = "http://localhost:8443/students";
const AuthStr = 'Bearer '.concat("eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiIxOTQ2NDA4NjE2IiwiZXhwIjoxNzI1OTM4NzA1LCJpYXQiOjE3MjU4Nzg3MDV9.fbEXRuNwn9EzxWJ6FGDVLAP5ZXG8gWnpBo_VWjr7AHcoPHaFAiMyRQxY4Up-Ah2ARoUsOFu552QhqesRJ0QUng"); 

class StudentService {

    getStudents(){
        return axios.get(STUDENT_API_BASE_URL, { headers: { Authorization: AuthStr } });
    }

    createStudent(student){
        return axios.post(STUDENT_API_BASE_URL, student);
    }

    getStudentById(studentId){
        return axios.get(STUDENT_API_BASE_URL + '/' + studentId);
    }

    updateStudent(student, studentId){
        return axios.put(STUDENT_API_BASE_URL + '/' + studentId, student);
    }

    deleteStudent(studentId){
        return axios.delete(STUDENT_API_BASE_URL + '/' + studentId);
    }
}

export default new StudentService()
